(2107, 'cky_banner_template', 'a:1:{s:2:\"en\";a:2:{s:4:\"html\";s:9983:\"<div class=\"cky-overlay cky-hide\"> </div><div class=\"cky-btn-revisit-wrapper cky-revisit-hide\" data-cky-tag=\"revisit-consent\" data-tooltip=\"Cookie Settings\" style=\"background-color:#0056A7\"> <button class=\"cky-btn-revisit\" aria-label=\"Cookie Settings\"> <img src=\"/wp-content/plugins/cookie-law-info/lite/frontend/images/revisit.svg\" alt=\"Revisit consent button\"> </button></div><div class=\"cky-consent-container cky-hide\"> <div class=\"cky-consent-bar\" data-cky-tag=\"notice\" style=\"background-color:#121212;border-color:#2a2a2a\">  <div class=\"cky-notice\"> <p class=\"cky-title\" data-cky-tag=\"title\" style=\"color:#d0d0d0\">Valoramos su privacidad</p><div class=\"cky-notice-group\"> <div class=\"cky-notice-des\" data-cky-tag=\"description\" style=\"color:#d0d0d0\"> <p>Utilizamos cookies para mejorar su experiencia de navegación, publicar anuncios o contenidos personalizados y analizar nuestro tráfico. Al hacer clic en \"Aceptar todo\", usted acepta nuestro uso de cookies.</p> </div><div class=\"cky-notice-btn-wrapper\" data-cky-tag=\"notice-buttons\"> <button class=\"cky-btn cky-btn-customize\" aria-label=\"Customize\" data-cky-tag=\"settings-button\" style=\"color:#d0d0d0;background-color:transparent;border-color:#d0d0d0\">Customize</button> <button class=\"cky-btn cky-btn-reject\" aria-label=\"Reject All\" data-cky-tag=\"reject-button\" style=\"color:#d0d0d0;background-color:transparent;border-color:#d0d0d0\">Reject All</button> <button class=\"cky-btn cky-btn-accept\" aria-label=\"Accept All\" data-cky-tag=\"accept-button\" style=\"color:#121212;background-color:#EFEFEF;border-color:#EFEFEF\">Accept All</button>  </div></div></div></div></div><div class=\"cky-modal\"> <div class=\"cky-preference-center\" data-cky-tag=\"detail\" style=\"color:#d0d0d0;background-color:#121212;border-color:#2A2A2A\"> <div class=\"cky-preference-header\"> <span class=\"cky-preference-title\" data-cky-tag=\"detail-title\" style=\"color:#d0d0d0\">Customize Consent Preferences</span> <button class=\"cky-btn-close\" aria-label=\"[cky_preference_close_label]\" data-cky-tag=\"detail-close\"> <img src=\"/wp-content/plugins/cookie-law-info/lite/frontend/images/close.svg\" alt=\"Close\"> </button> </div><div class=\"cky-preference-body-wrapper\"> <div class=\"cky-preference-content-wrapper\" data-cky-tag=\"detail-description\" style=\"color:#d0d0d0\"> <p>We use cookies to help you navigate efficiently and perform certain functions. You will find detailed information about all cookies under each consent category below.</p><p>The cookies that are categorized as \"Necessary\" are stored on your browser as they are essential for enabling the basic functionalities of the site. </p><p>We also use third-party cookies that help us analyze how you use this website, store your preferences, and provide the content and advertisements that are relevant to you. These cookies will only be stored in your browser with your prior consent.</p><p>You can choose to enable or disable some or all of these cookies but disabling some of them may affect your browsing experience.</p> </div><div class=\"cky-accordion-wrapper\" data-cky-tag=\"detail-categories\"> <div class=\"cky-accordion\" id=\"ckyDetailCategorynecessary\"> <div class=\"cky-accordion-item\"> <div class=\"cky-accordion-chevron\"><i class=\"cky-chevron-right\"></i></div> <div class=\"cky-accordion-header-wrapper\"> <div class=\"cky-accordion-header\"><button class=\"cky-accordion-btn\" aria-label=\"Necessary\" data-cky-tag=\"detail-category-title\" style=\"color:#d0d0d0\">Necessary</button><span class=\"cky-always-active\">Always Active</span> <div class=\"cky-switch\" data-cky-tag=\"detail-category-toggle\"><input type=\"checkbox\" id=\"ckySwitchnecessary\"></div> </div> <div class=\"cky-accordion-header-des\" data-cky-tag=\"detail-category-description\" style=\"color:#d0d0d0\"> <p>Necessary cookies are required to enable the basic features of this site, such as providing secure log-in or adjusting your consent preferences. These cookies do not store any personally identifiable data.</p></div> </div> </div> <div class=\"cky-accordion-body\"> <div class=\"cky-audit-table\" data-cky-tag=\"audit-table\" style=\"color:#d0d0d0;background-color:#2a2a2a;border-color:#474444\"><p class=\"cky-empty-cookies-text\">No cookies to display.</p></div> </div> </div><div class=\"cky-accordion\" id=\"ckyDetailCategoryfunctional\"> <div class=\"cky-accordion-item\"> <div class=\"cky-accordion-chevron\"><i class=\"cky-chevron-right\"></i></div> <div class=\"cky-accordion-header-wrapper\"> <div class=\"cky-accordion-header\"><button class=\"cky-accordion-btn\" aria-label=\"Functional\" data-cky-tag=\"detail-category-title\" style=\"color:#d0d0d0\">Functional</button><span class=\"cky-always-active\">Always Active</span> <div class=\"cky-switch\" data-cky-tag=\"detail-category-toggle\"><input type=\"checkbox\" id=\"ckySwitchfunctional\"></div> </div> <div class=\"cky-accordion-header-des\" data-cky-tag=\"detail-category-description\" style=\"color:#d0d0d0\"> <p>Functional cookies help perform certain functionalities like sharing the content of the website on social media platforms, collecting feedback, and other third-party features.</p></div> </div> </div> <div class=\"cky-accordion-body\"> <div class=\"cky-audit-table\" data-cky-tag=\"audit-table\" style=\"color:#d0d0d0;background-color:#2a2a2a;border-color:#474444\"><p class=\"cky-empty-cookies-text\">No cookies to display.</p></div> </div> </div><div class=\"cky-accordion\" id=\"ckyDetailCategoryanalytics\"> <div class=\"cky-accordion-item\"> <div class=\"cky-accordion-chevron\"><i class=\"cky-chevron-right\"></i></div> <div class=\"cky-accordion-header-wrapper\"> <div class=\"cky-accordion-header\"><button class=\"cky-accordion-btn\" aria-label=\"Analytics\" data-cky-tag=\"detail-category-title\" style=\"color:#d0d0d0\">Analytics</button><span class=\"cky-always-active\">Always Active</span> <div class=\"cky-switch\" data-cky-tag=\"detail-category-toggle\"><input type=\"checkbox\" id=\"ckySwitchanalytics\"></div> </div> <div class=\"cky-accordion-header-des\" data-cky-tag=\"detail-category-description\" style=\"color:#d0d0d0\"> <p>Analytical cookies are used to understand how visitors interact with the website. These cookies help provide information on metrics such as the number of visitors, bounce rate, traffic source, etc.</p></div> </div> </div> <div class=\"cky-accordion-body\"> <div class=\"cky-audit-table\" data-cky-tag=\"audit-table\" style=\"color:#d0d0d0;background-color:#2a2a2a;border-color:#474444\"><p class=\"cky-empty-cookies-text\">No cookies to display.</p></div> </div> </div><div class=\"cky-accordion\" id=\"ckyDetailCategoryperformance\"> <div class=\"cky-accordion-item\"> <div class=\"cky-accordion-chevron\"><i class=\"cky-chevron-right\"></i></div> <div class=\"cky-accordion-header-wrapper\"> <div class=\"cky-accordion-header\"><button class=\"cky-accordion-btn\" aria-label=\"Performance\" data-cky-tag=\"detail-category-title\" style=\"color:#d0d0d0\">Performance</button><span class=\"cky-always-active\">Always Active</span> <div class=\"cky-switch\" data-cky-tag=\"detail-category-toggle\"><input type=\"checkbox\" id=\"ckySwitchperformance\"></div> </div> <div class=\"cky-accordion-header-des\" data-cky-tag=\"detail-category-description\" style=\"color:#d0d0d0\"> <p>Performance cookies are used to understand and analyze the key performance indexes of the website which helps in delivering a better user experience for the visitors.</p></div> </div> </div> <div class=\"cky-accordion-body\"> <div class=\"cky-audit-table\" data-cky-tag=\"audit-table\" style=\"color:#d0d0d0;background-color:#2a2a2a;border-color:#474444\"><p class=\"cky-empty-cookies-text\">No cookies to display.</p></div> </div> </div><div class=\"cky-accordion\" id=\"ckyDetailCategoryadvertisement\"> <div class=\"cky-accordion-i