(188, 1, '2022-10-03 18:52:41', '2022-10-03 18:52:41', '.custom-logo-link{margin-left:100px;}\n\n@media screen and (max-width: 600px) {\n	.custom-logo-link {\n    margin:0;\n  }\n}\n\n#container {\n  \n  max-width: 768px;\n  margin: 60px 0px;\n  position: relative;\n	background:#E7E2E2;\n}\n\nform {\n}\n\nh1.formulario {\n	color:#424242;\n  letter-spacing: 7px;\n  text-align: center;\n  \n}\n\n.underline {\n	margin-top:-50px;\n}\n\n.icon_wrapper {\n  width: 100%;\n}\n\n.icon {\n  display: block;\n  fill: #474544;\n  height: 0px;\n  margin: 0 auto;\n  width: 50px;\n}\n\n.email {\n	float: right;\n	width: 45%;\n}\n\ninput[type=\'text\'], [type=\'email\'], select, textarea {\n	background: none;\n  border: none;\n	border-bottom: solid 2px #474544;\n	color: #474544;\n	font-size: 1.000em;\n  font-weight: 400;\n  letter-spacing: 1px;\n\n  text-transform: uppercase;\n	width: 100%;\n	-webkit-box-sizing: border-box;\n	-moz-box-sizing: border-box;\n	-ms-box-sizing: border-box;\n	-o-box-sizing: border-box;\n	box-sizing: border-box;\n	-webkit-transition: all 0.3s;\n	-moz-transition: all 0.3s;\n	-ms-transition: all 0.3s;\n	-o-transition: all 0.3s;\n	transition: all 0.3s;\n}\n\ninput[type=\'text\']:focus, [type=\'email\']:focus, textarea:focus {\n	outline: none;\n	padding: 0 0 0.875em 0;\n}\n\n.message {\n	float: none;\n}\n\n.name {\n	float: left;\n	width: 45%;\n}\n\nselect {\n  outline: none;\n  -moz-appearance: none;\n  -webkit-appearance: none;\n}\n\nselect::-ms-expand {\n  display: none;\n}\n\n.subject {\n  width: 99%;\n}\n\ntextarea {\n	line-height: 150%;\n	height: 140px;\n	resize: none;\n  width: 95%;\n}\n\n::-webkit-input-placeholder {\n	color: #474544;\n}\n\n:-moz-placeholder { \n	color: #474544;\n	opacity: 0;\n}\n\n::-moz-placeholder {\n	color: #474544;\n	opacity: 1;\n}\n\n:-ms-input-placeholder {\n	color: #474544;\n}\n\n#form_button {\n  background: gray;\n  border: solid 2px #474544;\n  cursor: pointer;\n  display: inline-block;\n  font-size: 0.875em;\n  font-weight: bold;\n  outline: none;\n  padding: 20px 35px;\n  text-transform: uppercase;\n  -webkit-transition: all 0.3s;\n	-moz-transition: all 0.3s;\n	-ms-transition: all 0.3s;\n	-o-transition: all 0.3s;\n	transition: all 0.3s;\n}\n\n#form_button:hover {\n  background: #474544;\n  color: #F2F3EB;\n}\n\n@media screen and (max-width: 768px) {\n  #container {\n    margin: 20px auto;\n    width: 95%;\n  }\n}\n\n@media screen and (max-width: 480px) {\n  h1 {\n    font-size: 26px;\n  }\n  \n  .underline {\n    width: 68px;\n  }\n  \n  #form_button {\n    padding: 15px 25px;\n  }\n}\n\n@media screen and (max-width: 420px) {\n  h1 {\n    font-size: 18px;\n  }\n  \n  .underline {\n    width: 53px;\n  }\n  \n  input[type=\'text\'], [type=\'email\'], select, textarea {\n    font-size: 0.875em;\n  }\n}\n\n.grid { \n  display: grid;\n  grid-template-columns: repeat(auto-fill, minmax(300px, 1fr));\n  grid-gap: 20px;\n  align-items: stretch;\n	justify-content:center;\n  }\n.grid > article {\n  border: 1px solid #ccc;\n  box-shadow: 2px 2px 6px 0px  rgba(0,0,0,0.3);\n}\n.grid > article img {\n  max-width: 100%;\n}\n.text {\n  padding: 0 20px 20px;\n}\n.text > button {\n  background: gray;\n  border: 0;\n  color: white;\n  padding: 10px;\n  width: 100%;\n  }\n\n.admin-bar .main_header.stick_header {\n  background: #FFF;\n}\n', 'pet-care-zone', '', 'publish', 'closed', 'closed', '', 'pet-care-zone', '', '', '2022-10-07 07:50:36', '2022-10-07 07:50:36', '', 0, 'http://localhost/gadoupas/2022/10/03/pet-care-zone/', 0, 'custom_css', '', 0),
