nAsunto: [your-subject]\r\n\r\nCuerpo del mensaje:\r\n[your-message]\r\n\r\n-- \r\nEste mensaje se ha enviado desde un formulario de contacto en [_site_title] ([_site_url])\nReply-To: [your-email]\n\n\n\n\n[_site_title] «[your-subject]»\n[_site_title] <mixwellodbv@gmail.com>\n[your-email]\nCuerpo del mensaje:\r\n[your-message]\r\n\r\n-- \r\nEste mensaje se ha enviado desde un formulario de contacto en [_site_title] ([_site_url])\nReply-To: [_site_admin_email]\n\n\n\nGracias por tu mensaje. Ha sido enviado.\nHa ocurrido un error al intentar enviar tu mensaje. Por favor, inténtalo de nuevo más tarde.\nUno o más campos tienen un error. Por favor, revísalos e inténtalo de nuevo.\nHa ocurrido un error al intentar enviar tu mensaje. Por favor, inténtalo de nuevo más tarde.\nDebes aceptar los términos y condiciones antes de enviar tu mensaje.\nPor favor, rellena este campo.\nEste campo tiene una entrada demasiado larga.\nEste campo tiene una entrada demasiado corta.\nHa ocurrido un error desconocido al subir el archivo.\nNo tienes permisos para subir archivos de este tipo.\nEl archivo subido es demasiado grande.\nHa ocurrido un error al subir el archivo.\nPor favor, introduce una fecha con el formato YYYY-MM-DD.\nEste campo tiene una fecha demasiado temprana.\nEste campo tiene una fecha demasiado tardía.\nPor favor, introduce un número.\nEste campo tiene un número demasiado pequeño.\nEste campo tiene un número demasiado grande.\nLa respuesta al cuestionario no es correcta.\nPor favor, introduce una dirección de correo electrónico.\nPor favor, introduce una URL.\nPor favor, introduce un número de teléfono.', 'New', '', 'publish', 'closed', 'closed', '', 'new', '', '', '2022-10-04 18:08:59', '2022-10-04 18:08:59', '', 0, 'http://localhost/gadoupas/?post_type=wpcf7_contact_form&#038;p=217', 0, 'wpcf7_contact_form', '', 0),
(218, 1, '2022-10-04 09:04:33', '2022-10-04 09:04:33', '<!-- wp:html -->\n<p style=\"color:black;\">Si te da pereza llamarnos o simplemente estamos ocupados y no podemos atender tu llamada, puedes rellenar el siguiente formulario y te daremos una respuesta lo antes posible.</p>\n<!-- /wp:html -->\n\n<!-- wp:contact-form-7/contact-form-selector {\"id\":217,\"title\":\"New\"} -->\n<div class=\"wp-block-contact-form-7-contact-form-selector\">[contact-form-7 id=\"217\" title=\"New\"]</div>\n<!-- /wp:contact-form-7/contact-form-selector -->', 'Contáctanos', '', 'inherit', 'closed', 'closed', '', '21-revision-v1', '', '', '2022-10-04 09:04:33', '2022-10-04 09:04:33', '', 21, 'http://localhost/gadoupas/?p=218', 0, 'revision', '', 0),
(221, 1, '2022-10-04 09:20:06', '2022-10-04 09:20:06', '.custom-logo-link{margin-left:100px;}\n\n@media screen and (max-width: 600px) {\n	.custom-logo-link {\n    margin:0;\n  }\n}\n\n@import url(https://fonts.googleapis.com/css?family=Montserrat:400,700);\n\nhtml {\n  font-family: \'Montserrat\', Arial, sans-serif;\n  -ms-text-size-adjust: 100%;\n  -webkit-text-size-adjust: 100%;\n}\n\nbody {\n  background: #F2F3EB;\n}\n\nbutton {\n  overflow: visible;\n}\n\nbutton, select {\n  text-transform: none;\n}\n\nbutton, input, select, textarea {\n  color: #5A5A5A;\n  font: inherit;\n  margin: 0;\n}\n\ninput {\n  line-height: normal;\n}\n\ntextarea {\n  overflow: auto;\n}\n\n#container {\n  border: solid 3px #474544;\n  max-width: 768px;\n  margin: 60px auto;\n  position: relative;\n}\n\nform {\n  padding: 37.5px;\n  margin: 50px 0;\n}\n\nh1 {\n  color: #474544;\n  font-size: 32px;\n  font-weight: 700;\n  letter-spacing: 7px;\n  text-align: center;\n  text-transform: uppercase;\n}\n\n.underline {\n  border-bottom: solid 2px #474544;\n  margin: -0.512em auto;\n  width: 80px;\n}\n\n.icon_wrapper {\n  margin: 50px auto 0;\n  width: 100%;\n}\n\n.icon {\n  display: block;\n  fill: #474544;\n  height: 50px;\n  margin: 0 auto;\n  width: 50px;\n}\n\n.email {\n	float: right;\n	width: 45%;\n}\n\ninput[type=\'text\'], [type=\'email\'], select, textarea {\n	background: none;\n  border: none;\n	border-bottom: solid 2px #474544;\n	color: #474544;\n	font-size: 1.000em;\n  font-weight: 400;\n  letter-spacing: 1px;\n	margin: 0em 0 1.875em 0;\n	padding: 0 0 0.875em 0;\n  text-transform: uppercase;\n	width: 100%;\n	-webkit-box-sizing: border-box;\n	-moz-box-sizing: border-box;\n	-ms-box-sizing: border-box;\n	-o-box-sizing: border-box;\n	box-sizing: border-box;\n	-webkit-transition: all 0.3s;\n	-moz-transition: all 0.3s;\n	-ms-transition: all 0.3s;\n	-o-transition: all 0.3s;\n	transition: all 0.3s;\n}\n\ninput[type=\'text\']:focus, [type=\'email\']:focus, textarea:focus {\n	outline: none;\n	padding: 0 0 0.875em 0;\n}\n\n.message {\n	float: none;\n}\n\n.name {\n	float: left;\n	width: 45%;\n}\n\nselect {\n  background: url(\'https://cdn4.iconfinder.com/data/icons/ionicons/512/icon-ios7-arrow-down-32.png\') no-repeat right;\n  outline: none;\n  -moz-appearance: none;\n  -webkit-appearance: none;\n}\n\nselect::-ms-expand {\n  display: none;\n}\n\n.subject {\n  width: 100%;\n}\n\n.telephone {\n  width: 100%;\n}\n\ntextarea {\n	line-height: 150%;\n	height: 150px;\n	resize: none;\n  width: 100%;\n}\n\n::-webkit-input-placeholder {\n	color: #474544;\n}\n\n:-moz-placeholder { \n	color: #474544;\n	opacity: 1;\n}\n\n::-moz-placeholder {\n	color: #474544;\n	opacity: 1;\n}\n\n:-ms-input-placeholder {\n	color: #474544;\n}\n\n#form_button {\n  background: none;\n  border: solid 2px #474544;\n  color: #474544;\n  cursor: pointer;\n  display: inline-block;\n  font-family: \'Helvetica\', Arial, sans-serif;\n  font-size: 0.875em;\n  font-weight: bold;\n  outline: none;\n  padding: 20px 35px;\n  text-transform: uppercase;\n  -webkit-transition: all 0.3s;\n	-moz-transition: all 0.3s;\n	-ms-transition: all 0.3s;\n	-o-transition: all 0.3s;\n	transition: all 0.3s;\n}\n\n#form_button:hover {\n  background: #474544;\n  color: #F2F3EB;\n}\n\n@media screen and (max-width: 768px) {\n  #container {\n    margin: 20px auto;\n    width: 95%;\n  }\n}\n\n@media screen and (max-width: 480px) {\n  h1 {\n    font-size: 26px;\n  }\n  \n  .underline {\n    width: 68px;\n  }\n  \n  #form_button {\n    padding: 15px 25px;\n  }\n}\n\n@media screen and (max-width: 420px) {\n  h1 {\n    font-size: 18px;\n  }\n  \n  .icon {\n    height: 35px;\n    width: 35px;\n  }\n  \n  .underline {\n    width: 53px;\n  }\n  \n  input[type=\'text\'], [type=\'email\'], select, textarea {\n    font-size: 0.875em;\n  }\n}', 'pet-care-zone', '', 'inherit', 'closed', 'closed', '', '188-revision-v1', '', '', '2022-10-04 09:20:06', '2022-10-04 09:20:06', '', 188, 'http://localhost/gadoupas/?p=221', 0, 'revision', '', 0)