ainer-form{\n	width:600px;\n	background:gainsboro;\n	border-radius:10px;\n	padding-top:40px;\n	margin-top:20px;\n	margin-left:auto;\n	margin-right:auto;\n	text-align:center;\n}\n.container-form input{border-radius:10px;}\n.casilla-verificacion{\n	margin-top:20px;\n}\n.form-msg{\n	\n}\n.legal{\n	text-align:left;\n	margin-left:27px;\n}\n/* Fin formulario */\n\n/* Footer */\n\n.wp-image-13{\n	border-radius:10px !important;\n}\n.contenido-footer{padding-top:50px;}\n.texto-footer{line-height:15px;}', 'neve', '', 'inherit', 'closed', 'closed', '', '408-revision-v1', '', '', '2022-11-29 13:00:50', '2022-11-29 13:00:50', '', 408, 'http://localhost/gadoupas/?p=748', 0, 'revision', '', 0),
