(758, 1, '2022-11-29 13:08:42', '2022-11-29 13:08:42', '/* Smooth */\nhtml{scroll-behavior: smooth;}\n\n/* Ajustes globales: tipografías etc... */\nhtml{\n	font-family:Arial;\n}\nh1,h2,h3,h4{\n	text-transform:uppercase;\n	letter-spacing:1.6px;\n}\nh1{font-size:40px;}\nh2{font-size:25px;padding-top:25px;}\nh3{font-size:15px;}\n.h5-uppercase{\n	text-transform:uppercase;\n	letter-spacing:1.6px;\n	font-size:16px;\n}\n\n/* Header */\n\n/* MENÚ */\n.nav-menu-primary, .sub-menu{\n	text-transform:uppercase;\n	letter-spacing:1.5px;\n}\n\n.dropdown-open{padding-top:40px;}\n\n.m-style > ul > li > a::after, .sm-style .sub-menu a::after{\n	background-color:none !important;\n}\n\n.nav-ul a:hover{\n	color:black;\n	/*text-decoration:underline;*/\n}\n\n/* FADE MENÚ */\n#menu-item-361,\n#menu-item-532,\n#menu-item-526,\n#menu-item-538 {\n	opacity: 0.8;\n\n/*Transition*/\n	-webkit-transition: all 0.5s ease;\n	-moz-transition: all 0.5s ease;\n	-o-transition: all 0.5s ease;\n/*Reflection*/\n	-webkit-box-reflect: below 0px -webkit-gradient(linear, left top, left\nbottom, from(transparent), color-stop(0.7, transparent), to(rgba(0, 0, 0, 0.1)));\n      }\n\n#menu-item-361:hover,\n#menu-item-532:hover,\n#menu-item-526:hover,\n#menu-item-538:hover {\n	opacity: 1;\n/*Reflection*/\n	-webkit-box-reflect: below 0px -webkit-gradient(linear, left top, left\nbottom, from(transparent), color-stop(0.7, transparent), to(rgba(0, 0, 0, 0.4)));\n/*Glow*/\n	-webkit-box-shadow: 0px 0px 10px rgba(255, 255, 255, 0.8);\n	-moz-box-shadow: 0px 0px 10px rgba(255, 255, 255, 0.8);\nbox-shadow: 0px 5px 20px rgba(255, 255, 255, 0.8);\n	border-radius:5px;\n      }\n/* FIN FADE MENÚ */\n/* FIN MENÚ */\n\n/* FIN Header */\n\n\n/* Grid peludos */\n.grid-peludos{\n	padding-top:20px;\n	padding-bottom:50px;\n}\n/* Fin grid peludos */\n\n/* Razas */\n#razas h5{\n	margin-bottom:7px;\n	letter-spacing:1px;\n}\n#razas a{\n	text-decoration:none;\n}\n.razas-gatos{\nmargin-top: -40px;\nmargin-bottom: -30px !important;\n}\n.boton-razas{\n	padding:10px;\n	\n}\n/* Fin Razas */\n\n/* Formulario */\n.container-form{\n	width:600px;\n	background:gainsboro;\n	border-radius:10px;\n	padding-top:40px;\n	margin-top:20px;\n	margin-left:auto;\n	margin-right:auto;\n	text-align:center;\n}\n.container-form input{border-radius:10px;}\n.casilla-verificacion{\n	margin-top:20px;\n}\n.form-msg{\n	\n}\n.legal{\n	text-align:left;\n	margin-left:27px;\n}\n/* Fin formulario */\n\n/* Footer */\n\n.wp-image-13{\n	border-radius:10px !important;\n}\n.contenido-footer{padding-top:50px;}\n.texto-footer{line-height:15px;}', 'neve', '', 'inherit', 'closed', 'closed', '', '408-revision-v1', '', '', '2022-11-29 13:08:42', '2022-11-29 13:08:42', '', 408, 'http://localhost/gadoupas/?p=758', 0, 'revision', '', 0),
