(801, 1, '2022-11-29 17:09:41', '2022-11-29 17:09:41', '{\n    \"custom_css[neve]\": {\n        \"value\": \"/* Smooth */\\nhtml{scroll-behavior: smooth;}\\n\\n/* Ajustes globales: tipograf\\u00edas etc... */\\nhtml{\\n\\tfont-family:Arial;\\n}\\nh1,h2,h3,h4{\\n\\ttext-transform:uppercase;\\n\\tletter-spacing:1.6px;\\n}\\nh1{font-size:40px;}\\nh2{font-size:25px;padding-top:25px;}\\nh3{font-size:15px;}\\n.h5-uppercase{\\n\\ttext-transform:uppercase;\\n\\tletter-spacing:1.6px;\\n\\tfont-size:16px;\\n}\\n\\n/* Header */\\n\\n/* MEN\\u00da */\\n.nav-menu-primary, .sub-menu{\\n\\ttext-transform:uppercase;\\n\\tletter-spacing:1.5px;\\n}\\n\\n.dropdown-open{padding-top:40px;}\\n\\n.m-style > ul > li > a::after, .sm-style .sub-menu a::after{\\n\\tbackground-color:none !important;\\n}\\n\\n.nav-ul a:hover{\\n\\tcolor:black;\\n\\t/*text-decoration:underline;*/\\n}\\n\\n/* FADE MEN\\u00da */\\n#menu-item-361,\\n#menu-item-532,\\n#menu-item-526,\\n#menu-item-538 {\\n\\topacity: 0.8;\\n\\n/*Transition*/\\n\\t-webkit-transition: all 0.5s ease;\\n\\t-moz-transition: all 0.5s ease;\\n\\t-o-transition: all 0.5s ease;\\n/*Reflection*/\\n\\t-webkit-box-reflect: below 0px -webkit-gradient(linear, left top, left\\nbottom, from(transparent), color-stop(0.7, transparent), to(rgba(0, 0, 0, 0.1)));\\n      }\\n\\n#menu-item-361:hover,\\n#menu-item-532:hover,\\n#menu-item-526:hover,\\n#menu-item-538:hover {\\n\\topacity: 1;\\n/*Reflection*/\\n\\t-webkit-box-reflect: below 0px -webkit-gradient(linear, left top, left\\nbottom, from(transparent), color-stop(0.7, transparent), to(rgba(0, 0, 0, 0.4)));\\n/*Glow*/\\n\\t-webkit-box-shadow: 0px 0px 10px rgba(255, 255, 255, 0.8);\\n\\t-moz-box-shadow: 0px 0px 10px rgba(255, 255, 255, 0.8);\\nbox-shadow: 0px 5px 20px rgba(255, 255, 255, 0.8);\\n\\tborder-radius:5px;\\n      }\\n/* FIN FADE MEN\\u00da */\\n/* FIN MEN\\u00da */\\n\\n/* FIN Header */\\n\\n\\n/* Grid peludos */\\n.grid-peludos{\\n\\tpadding-top:20px;\\n\\tpadding-bottom:50px;\\n}\\n/* Fin