(809, 1, '2022-11-29 17:12:44', '2022-11-29 17:12:44', '[vc_row][vc_column][vc_column_text]\r\n<h2>Quiero un Border Terrier, qué necesito saber</h2>\r\n[/vc_column_text][vc_separator][/vc_column][vc_column offset=\"vc_col-lg-7\"][vc_column_text]\r\n<h3>Para empezar...</h3>\r\n<strong>Altura a la cruz: </strong>alrededor de 30 cm\r\n<strong>Peso:</strong> machos de 6 a 7kg | hembras de 5 a 6,5kg\r\n<strong>Capa: </strong>roja, trigo, grisácea y fuego, azul y fuego\r\n<strong>Aptitudes: </strong>perro de caza[/vc_column_text][vc_column_text css=\".vc_custom_1669741698628{border-radius: 4px !important;}\" el_class=\"cuadro-detalle-perro\"]<strong>Clasificación general: </strong>Razas de perros pequeños\r\n<strong>Clasificación según la AKC: </strong>Grupo 4: Terriers\r\n<strong>Clasificación según la FCI:</strong> Grupo 3: Terriers &gt; Terriers de talla grande y media[/vc_column_text][/vc_column][vc_column offset=\"vc_col-lg-5\"][vc_single_image image=\"794\" img_size=\"full\"][/vc_column][vc_column][/vc_column][/vc_row][vc_row][vc_column][vc_column_text]\r\n<h3>Origen</h3>\r\nSe conocen grabados del <strong>Border-Terrier</strong> desde el siglo XVII, en los que aparece acompañando tanto a los señores en la caza del zorro como vigilando animales de corral y ovejas. Pero no fue hasta mediados del siglo XIX en que los expertos se empezaron a fijar en esta raza, establecida hacía años como perro de trabajo en las familias del norte de Inglaterra.\r\n<h3>Comportamiento</h3>\r\nEl <strong>Border Terrier</strong> tiene muy buen carácter, es impetuoso, paciente y obstinado. Debido a su sociabilidad se adapta bien a la vida familiar y llega a ser un compañero muy fiel, aunque también es independiente y le gusta tomar sus propias decisiones. Este es un perro de caza y no dudará en perseguir los pequeños roedores que estén a su alcance.\r\n<h3>Aspecto</h3>\r\nEl <strong>Border-Terrier</strong>, de cara parecido a una nutria, es alto, estrecho y bastante largo. Sus extremidades son rectas y de osamenta poco pesada. Tiene unas orejas pequeñas en forma de “v” que caen hacia delante y una cola mediana implantada alta. Es de piel gruesa cubierta por un pelo duro y denso. Este perro puede ser de color rojo, trigueño, grisáceo y fuego o azul y fuego.\r\n<h3>Cuidados específicos</h3>\r\nHay que iniciar la educación del <strong>Border Terrier</strong> desde pequeño, es importante que esté rodeado de personas y perros para que no se vuelva introvertido. Al ser de tamaño pequeño se adapta bien en interiores pero no se debe olvidar que proviene del campo y que le gusta dar largos paseos.\r\n<h3>Salud</h3>\r\nEl <strong>Border-Terrier</strong> es un animal resistente, aunque en algunos casos puede padecer problemas de corazón congénitos, <a href=\"https://www.mundoanimalia.com/articulo/La_Displasia_de_Cadera\">displasia de cadera</a> y atrofia progresiva de retina.[/vc_column_text][/vc_column][/vc_row]', 'Border Terrier', '', 'inherit', 'closed', 'closed', '', '787-revision-v1', '', '', '2022-11-29 17:12:44', '2022-11-29 17:12:44', '', 787, 'http://localhost/gadoupas/?p=809', 0, 'revision', '', 0),
